import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

interface TodoDto {
  id: number;
  title: string;
  completed: boolean;
}

@Injectable({
  providedIn: 'root',
})
export class TodoService {
  constructor(private http: HttpClient) {}
  getTodos() {
    return this.http.get<TodoDto>('https://jsonplaceholder.typicode.com/todos');
  }
}
